commits.content:
.sidenav-container {
  height: 100%;
}

.sidenav {
  width: 200px;
}

.sidenav .mat-toolbar {
  background: inherit;
}

.mat-toolbar.mat-primary {
  position: sticky;
  top: 0;
  z-index: 1;
}
.flex-spacer {
  flex: 1 1 auto;
}
.username {
  margin-right: 10px;
}

.logout-icon {
  font-size: 15px;
  cursor: pointer;
}
